import './Img_Diamonds.css';
import React, { useEffect } from 'react';

export default () => {

    useEffect(() => {
        const img1 = new Image();
        img1.src = 'data:image/png;base64,'

        img1.addEventListener('load', () => {
            const canvas = document.getElementById('canvas1');
            const ctx = canvas.getContext('2d');
            canvas.width = 515;
            canvas.height = 350;

            ctx.drawImage(img1, 0, 0, canvas.width, canvas.height);
            const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            let particlasArra = [];
            const numOfParticals = 5000;

            let mappedImage = [];
            for (let y = 0; y < canvas.height; y++) {
                let row = [];
                for (let x = 0; x < canvas.width; x++) {
                    const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                    const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                    const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                    const brightness = calcolateRealtivbrightness(red, green, blue);
                    let cell = [
                        brightness,
                    ];
                    row.push(cell)
                }
                mappedImage.push(row);
            }
            function calcolateRealtivbrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 +
                    (green * green) * 0.587 +
                    (blue * blue) * 0.114
                ) / 100;
            }
            class Particle {
                constructor() {
                    this.x = Math.random() * canvas.width;
                    this.y = 0;
                    this.speed = 0;
                    this.velocity = Math.random() * 10.5;
                    this.size = Math.random() * 1.5 + 1;
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                }
                update() {
                    // this.position1 = Math.floor(this.y);
                    // this.position2 = Math.floor(this.x);
                    this.speed = mappedImage[this.position1][this.position2][0];
                    let movement = (2.5 - this.speed) + this.velocity;
                    this.y += movement;
                    if (this.y >= canvas.height) {
                        this.y = 0;
                        this.x = Math.random() * canvas.width;
                    }
                }
                draw() {
                    ctx.beginPath();
                    ctx.fillStyle = 'black';
                    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                    ctx.fill();
                }
            }
            function init() {
                for (let i = 0; i < numOfParticals; i++) {
                    particlasArra.push(new Particle)
                }
            }
            init();
            function animation() {
                ctx.drawImage(img1, 0, 0, canvas.width, canvas.height);
                ctx.globalAlpha = 0.05;
                ctx.fillStyle = 'black';
                ctx.fillRect(0, 0, canvas.width, canvas.height);
                ctx.globalAlpha = 0.2;
                for (let i = 0; i < particlasArra.length; i++) {
                    particlasArra[i].update();
                    ctx.globalAlpha = particlasArra[i].speed * 0.5;
                    particlasArra[i].draw();
                }
                requestAnimationFrame(animation)
            }
            animation();
        });
    }, []);

    return (
        <body>
            <canvas id="canvas1"></canvas>
        </body>
    )
}






